import React from 'react'
import './articlesList.css'

function ArticlesPaintings(props) {
  return (
      <div className='article__card'>
        <img src={props.image} className='article__card_image'/>
        <p className='article__card_text' style={{backgroundColor: props.isWhite ? 'rgba(98, 98, 98, .8)' : 'rgba(0, 0, 0, .3)'}}>{props.title}</p>
      </div>
  )
}

export default ArticlesPaintings
